import React from "react";
import Pioneer from "../../assets/images/brands/pioneer.png";
import Sony from "../../assets/images/brands/sony-1.png";
import Yamaha from "../../assets/images/brands/yamaha.png";
import AudioTechnica from "../../assets/images/brands/audio-technica.png";
const BrandSection = () => {
  return (
    <section className="section-brands p-5 m-0 mr-0  mt-0 pt-0 ">
      <h1 className="text-2xl mb-3 ">Featured Brands</h1>
      <div className="row gap-2 items-center ">
        <img
          src={Pioneer}
          alt="pioneer"
          className="img w-52 bg-light p-2 br-sm h-18 contain"
        />
        <img
          src={Yamaha}
          alt="yamaha"
          className="img w-52  p-2 br-sm h-18 bg-light contain"
        />
        <img
          src={Casio}
          alt="casio"
          className="img w-52 p-2 br-sm bg-light h-18 contain"
        />
        <img
          src={Sony}
          alt="sony"
          className="img w-52 p-2 br-sm h-18 bg-light contain"
        />
        <img
          src={AudioTechnica}
          alt="audio-technica"
          className="img w-52 p-2 bg-light br-sm h-18 contain"
        />
      </div>
    </section>
  );
};

export default BrandSection;
